                    <div class="card-header pb-0 text-center">
                      <img src="../img/LogoWMP.svg" alt="logoWMP.svg" class="mt-4">

                          <input type="password" id="senha" class="form-control" placeholder="Digite sua senha" aria-label="Password">

                            <input class="form-check-input" type="checkbox" id="rememberMe" checked="">

                        </div>                        
                        <div class="text-center">
                          <button type="button" id="entrar" class="btn w-100 mt-4 mb-0" style="background-color: #093576; color: #fff;">Entrar</button>

  <script>
    const win = navigator.platform.indexOf('Win') > -1;
    if (win && document.querySelector('#sidenav-scrollbar')) {
      const options = {
        damping: '0.5'
      }
      Scrollbar.init(document.querySelector('#sidenav-scrollbar'), options);
    }

    const ident = document.getElementById('ident')
    const senha = document.getElementById('senha')
    const login = document.getElementById('entrar')
    const alertbtn = document.getElementById('alertCampos')
    const alertbtn2 = document.getElementById('alertCampos2')  
    
    document.addEventListener('DOMContentLoaded', function(){
      login.addEventListener('click',function(){
       if( ident.value === '' || senha.value === ''){
        alertbtn.style.display = 'block'
        setTimeout(function() {
        alertbtn.style.display = 'none';
      }, 3000);
        return
       }
        let listaUser = []
        let userValid = {
      name:'',
      ident:'',
      senha:'' 
    }
    
    listaUser = JSON.parse(localStorage.getItem('listaUser'))

    listaUser.forEach((item) => {
      if (email.value == item.identCad && senha.value == item.senhaCad) {
        userValid = {
          ident: item.identCad,
          senha: item.senhaCad
        }
      }
    })
console.log(userValid)
    if(email.value === userValid.email && senha.value === userValid.senha){
      window.location.href = 'http://127.0.0.1:5501/pages/home/home.html'
      let token = Math.random().toString(16).substring(2) + Math.random().toString(16).substring(2)
      localStorage.setItem('token', token)
      localStorage.setItem('userLogado', JSON.stringify(userValid))
    }else {
      alertbtn2.style.display = 'block'

      setTimeout(function() {
        alertbtn2.style.display = 'none';
      }, 3000);
        return
    }
  })
})
